import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import React from 'react';
import Navbar from './components/Navbar';
import Tagline from './components/Tagline';
import Footer from './components/Footer';
import Home from './components/pages/Home';
import Capabilities from './components/pages/Capabilities';
import Works from './components/pages/Works';
import Studio from './components/pages/Studio';

import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />
          <div className='livestream-container'>
          <div className='livestream-video-container'>
              <iframe className='livestream-video' title="Livestream-video" src="https://vimeo.com/event/2049063/embed" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen></iframe>
          </div>
            <iframe className='livestream-chat' title="QA-chat"src="https://vimeo.com/event/2048912/chat/" width="400px" height="600px" frameborder="0"></iframe>          
          </div>
        <Routes>
          <Route path='/' exact component={Home} />
          <Route path='/capabilities' component={Capabilities} />
          <Route path='/works' component={Works} />
          <Route path='/studio' component={Studio} />
        </Routes>
        <Tagline />
        <Footer />
      </Router>
    </>
  );
}

export default App;
